import React from "react";
import {Card, Grid, GridColumn, CardContent, CardHeader, CardDescription} from "semantic-ui-react";

function asd() {
    alert("asd");
}


function People( {data} ) {
    return (
        <>
            <div className="dark-light-div">
                <div className="box">
                <div className="imgBox">
                    <img id="dark-side" src="https://i.ibb.co/G0n2yhS/the-darkside-and-the-light-starwars-lastjedi-wallpapers-4000x2250.jpg" alt="dark-side" />
                </div>
                </div>
                <div className="box">
                <div className="imgBox">
                    <img id="light-side" src="https://i.ibb.co/JRqspFt/light.jpg" alt="light-side" />
                </div>
            </div>
            </div>
            <h1>People</h1>
            <Grid columns={3}>
                {data.map((people,i) => {
                    return(
                        <GridColumn key={i}>
                            <Card>
                                <CardContent>
                                    <CardHeader>{people.name}</CardHeader>
                                    <CardDescription>
                                        <strong>Height</strong>
                                        <p>{people.height}</p>
                                        <strong>Mass</strong>
                                        <p>{people.mass}</p>
                                        <strong>Gender</strong>
                                        <p>{people.gender}</p>
                                    </CardDescription>
                                </CardContent>
                            </Card>
                        </GridColumn>
                    )
                })}
            </Grid>
            <div id="prev-next-div">
                 <a id ="prevButton" href="http://localhost:3000/people/?page=2" onClick={asd} className="next round">&#8249;</a>
                 <a id ="nextButton" href="http://swapi.dev/api/people/?page=3" onClick={asd} className="next round">&#8250;</a>
            </div>
            
        </>
    )
}
export default People;
